-- ----------------------------
--  Function structure for `RandomInt`
-- ----------------------------
DROP FUNCTION IF EXISTS `RandomInt`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `RandomInt`(minVal INT, maxVal INT) RETURNS int(11)
BEGIN
    RETURN (minVal + FLOOR(RAND() * ((maxVal - minVal)+1)));
  END
 ;;
delimiter ;

-- ----------------------------
--  Function structure for `retrieveOrgAncestorIds`
-- ----------------------------
DROP FUNCTION IF EXISTS `retrieveOrgAncestorIds`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `retrieveOrgAncestorIds`(leafId INT) RETURNS varchar(1000) CHARSET utf8
BEGIN
    DECLARE sTemp VARCHAR(1000);
    DECLARE sTempChd VARCHAR(1000);

    SET sTemp = '';
    SET sTempChd = cast(leafId AS CHAR);

    WHILE sTempChd IS NOT NULL DO
      IF LENGTH(sTemp) > 0
      THEN
        SET sTemp = concat(sTempChd, ',', sTemp);
      ELSE
        SET sTemp = sTempChd;
      END IF;
      SELECT parent_id INTO sTempChd FROM organization WHERE id = sTempChd;
    END WHILE;
    RETURN sTemp;
  END
 ;;
delimiter ;

-- ----------------------------
--  Function structure for `retrieveOrgDescendantIds`
-- ----------------------------
DROP FUNCTION IF EXISTS `retrieveOrgDescendantIds`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `retrieveOrgDescendantIds`(rootId INT) RETURNS varchar(1000) CHARSET utf8
BEGIN
    DECLARE sTemp VARCHAR(1000);
    DECLARE sTempChd VARCHAR(1000);

    SET sTemp = '';
    SET sTempChd = cast(rootId AS CHAR);

    WHILE sTempChd IS NOT NULL DO
      IF LENGTH(sTemp) > 0
      THEN
        SET sTemp = concat(sTemp, ',', sTempChd);
      ELSE
        SET sTemp = concat(sTemp, sTempChd);
      END IF;
      SELECT group_concat(id) INTO sTempChd FROM organization WHERE FIND_IN_SET(parent_id, sTempChd) > 0;
    END WHILE;
    RETURN sTemp;
  END
 ;;
delimiter ;

-- ----------------------------
--  Function structure for `retrieveOrgSubParentId`
-- ----------------------------
DROP FUNCTION IF EXISTS `retrieveOrgSubParentId`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `retrieveOrgSubParentId`(pTopId INT, pOrgId INT) RETURNS int(11)
BEGIN
    DECLARE vAncestorIds VARCHAR(1000);
    DECLARE vNumIDs INT;
    DECLARE vIdx INT;
    DECLARE vID VARCHAR(50);
    DECLARE vTopFound BOOL;

    SET vAncestorIds = retrieveOrgAncestorIds(pOrgId);
    SET vNumIDs = substrCount(',', vAncestorIds) + 1;
    SET vIdx = 1;
    SET vTopFound = FALSE;
    WHILE vIdx <= vNumIDs DO
      SET vID = CAST(splitStrAt(vAncestorIds, ',', vIdx) AS UNSIGNED);
      IF vID = pTopId
      THEN
        SET vTopFound = TRUE;
      ELSE
        IF vTopFound
        THEN
          RETURN vID;
        END IF;
      END IF;
      SET vIdx = vIdx + 1;
    END WHILE;
    RETURN 0;
  END
 ;;
delimiter ;

-- ----------------------------
--  Function structure for `retrieveOrgSubParentName`
-- ----------------------------
DROP FUNCTION IF EXISTS `retrieveOrgSubParentName`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `retrieveOrgSubParentName`(pTopId INT, pOrgId INT) RETURNS text CHARSET utf8
BEGIN
    DECLARE vAncestorIds VARCHAR(1000);
    DECLARE vNumIDs INT;
    DECLARE vIdx INT;
    DECLARE vID VARCHAR(50);
    DECLARE vTopFound BOOL;
    DECLARE vName TEXT;

    SET vAncestorIds = retrieveOrgAncestorIds(pOrgId);
    SET vNumIDs = substrCount(',', vAncestorIds) + 1;
    SET vIdx = 1;
    SET vTopFound = FALSE;
    WHILE vIdx <= vNumIDs DO
      SET vID = CAST(splitStrAt(vAncestorIds, ',', vIdx) AS UNSIGNED);
      IF vID = pTopId
      THEN
        SET vTopFound = TRUE;
      ELSE
        IF vTopFound
        THEN
          SELECT name INTO vName FROM organization WHERE id=vID;
          RETURN vName;
        END IF;
      END IF;
      SET vIdx = vIdx + 1;
    END WHILE;
    RETURN NULL;
  END
 ;;
delimiter ;

-- ----------------------------
--  Function structure for `splitStrAt`
-- ----------------------------
DROP FUNCTION IF EXISTS `splitStrAt`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `splitStrAt`(x VARCHAR(255), delim VARCHAR(12), pos INT) RETURNS varchar(255) CHARSET utf8
RETURN REPLACE(SUBSTRING(SUBSTRING_INDEX(x, delim, pos), LENGTH(SUBSTRING_INDEX(x, delim, pos - 1)) + 1), delim, '')
 ;;
delimiter ;

-- ----------------------------
--  Function structure for `substrCount`
-- ----------------------------
DROP FUNCTION IF EXISTS `substrCount`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `substrCount`(ch CHAR, str TEXT) RETURNS int(11)
    DETERMINISTIC
BEGIN
    RETURN (LENGTH(str) - LENGTH(REPLACE(str, ch, '')));
  END
 ;;
delimiter ;

